@wiseroner This half sleeve was very challenging but it was really fun and I love how it came out! I had to tap into what I learned from @solsticeink_poet in regards to coverups which are both a physical and mental challenge and I am grateful for such a good tattoo mentor and homie.
And Thank you to my client for the trust!
